(1, '<h4 class=\"MsoNormal\" style=\"text-align: center;\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span lang=\"EN-IN\">Privacy Policy of Gond Sarkar International Pvt. Ltd.</span></u></strong></h4>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Effective Date: October 14, 2023</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">This Privacy Policy outlines the privacy practices and legal details governing the collection, use, and protection of your personal information when you use the website operated by Gond Sarkar International Pvt. Ltd. (\"Gond Sarkar International Pvt. Ltd.\", \"we,\" \"us,\" or \"our\"). Please take the time to carefully review this policy to understand how we handle your data and ensure the protection of your privacy. If you have any inquiries or concerns about this policy, please do not hesitate to contact us through our website or at our physical address:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Gond Sarkar International Pvt. Ltd.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">2070, Block-GE 178, Rajdanga Main Road,</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Kolkata 700107, India</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Phone: 9831581634</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">1. Collection of Information</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">We collect two primary categories of information from users of our website:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">a. Personal Information:This category encompasses information that directly identifies you as an individual. It includes data such as your name, email address, contact number, shipping address, country, date of birth, and profile picture.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">b. Non-Personal Information:This category includes data that does not directly identify you but is collected as you interact with our website. This data encompasses transaction amounts, bank details, online identifiers (such as IP addresses), technical data (device information, location, network carrier), communication details (metadata from emails, SMS, instant messages, and calls), and usage data (how you interact with our website).</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">2. Registration and Ordering</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">To access specific sections of our website or place orders for products, you may be required to complete an online registration form. During the registration process, we will request personal information, including but not limited to your name, size, shipping and billing addresses, phone number, and email address. This information is essential for creating your account, processing your orders, and communicating with you effectively.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">3. My Profile Section and Contests and Promotions</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">We may also request additional personal information through our \"My Profile\" section to serve you better. This information may include your anniversary or birth dates, as well as your personal preferences. Periodically, we run contests and promotions to gather information from our customers. Participation in these contests is entirely voluntary, and you have the choice to provide or withhold information.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">4. Email Addresses</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Our website allows you to enter your email address for various purposes, including but not limited to registering for promotions, requesting notifications about specific offers or products, or signing up for our email newsletter and special offers. Your participation in contests is voluntary, and providing your email address is your choice. We use your email address to notify contest winners and distribute prizes. Please note that we may post contest winners\' names and cities on our website and social media profiles.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">5. Cookies and Other Technology</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">To enhance the responsiveness of our website to your needs, we use cookies, which are small text files stored on your computer\'s hard drive. These cookies assign each visitor a unique identifier, but they do not personally identify individuals. We also utilize web beacons, which help us determine if a web page on the site has been viewed and track user behavior. This technology is industry-standard and widely used by websites. Most web browsers are initially set to accept cookies, but you have the option to configure your browser settings to refuse cookies or delete them from your hard drive. However, please be aware that blocking or deleting cookies may limit your access to certain parts of our website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">6. Log Files</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Like many other websites, our site automatically identifies the Internet URL from which you access it. Additionally, we maintain log files that record your Internet Protocol (IP) address, Internet service provider, and the date/time stamp of your activities on our website. We use this data for system administration, order verification, internal marketing, and system troubleshooting purposes. An IP address can provide information about the location of your computer on the Internet.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">7. Information Use &amp; Disclosure</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">The information you provide is used for various purposes, including but not limited to:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Facilitating your use of our website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Responding to your inquiries, requests, and concerns.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Providing you with information about our products and services and sending you materials and offers.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Sending you important notifications regarding our website, changes to our terms of service, and other relevant policies.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Sending you surveys and marketing communications that we believe may be of interest to you.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Personalizing your experience on our website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Processing and fulfilling your purchases, including payment processing, order confirmation, and customer service.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Administering product downloads and internal data analysis.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Improving the services, content, and advertising on our website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Complying with legal requirements and disclosures provided under Indian laws.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">We want to assure you that we will not sell, share, transfer, or rent any information that can identify a natural person, whether directly or indirectly, to others in ways different from what is disclosed in this Privacy Policy. Your information will be kept confidential to the greatest extent possible and in accordance with the provisions set out in this policy.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">8. Internal Use</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Internally, we may use your personal information to:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Enhance the content and layout of our website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Improve our outreach and marketing efforts, including marketing our services and products to you.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Conduct internal reviews and data analysis to understand user behavior and improveour services.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- Gather general marketplace information about visitors to our site.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">9. Communication with You</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">We may make calls, send SMS messages, and email you to keep you updated about our latest collections, exciting deals, and partner offers. We value your privacy and adhere to our policy to ensure your details are safe with us. We use your personal information to process and fulfill your orders, communicate with you regarding your purchases, and provide you with other client services, such as order confirmation when using cash-on-delivery mode. When you register with us, we may send you a confirmation email. Additionally, you may submit your email address to register for promotions, request notifications about specific offers or products, or sign up for our email newsletter and special offers. If you submit your email address, we use it to deliver this information to you. We always give you the option to unsubscribe or opt out of future emails, and an \"Unsubscribe\" link is included in all our promotional emails. However, please note that you cannot opt out of receiving emails related to your orders or your membership.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">10. External Use</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Our primary goal is to provide excellent service and offer a wide selection of products on our website. We do not sell, rent, trade, license, or otherwise disclose your specific personal information or financial information to anyone, except in the following cases:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- We use service providers (such as courier services) to perform specific functions on our behalf. When we disclose information to these service providers, it is solely for the purpose of enabling them to perform their services. For example, in the case of courier services, we may provide them with personally identifiable information such as your name, shipping address, email, and phone number.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- We may be required to disclose your personal information in response to requests from law enforcement officials conducting investigations, subpoenas, court orders, or if we are otherwise required to disclose such information by law. We will also release personal information where disclosure is necessary to protect our legal rights, enforce our Terms of Use or other agreements, or to protect ourselves or others. For example, we may share information to reduce the risk of fraud or if someone uses our site for illegal reasons or to commit fraud.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- We may share personal information and non-personal information with entities controlling, controlled by, or under common control with us. In the event that Gond Sarkar International Pvt. Ltd. is merged, sold, or undergoes a transfer of some or all of our assets, we may disclose such information in connection with such transactions, subject to the Privacy Policy then in effect.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">- We may share aggregate, non-personal information (such as the number of daily visitors to a particular web page or the size of an order placed on a certain date) with third parties such as advertising partners. This information does not directly personally identify you or any user.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">11. Data Security</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">All information collected by Gond Sarkar International Pvt. Ltd. is stored securely within a controlled database. The database is stored on servers secured behind a firewall, and access to the servers is password-protected and strictly limited. However, while our security measures are effective, no security system is impenetrable. We cannot guarantee the security of our database, nor can we guarantee that information you supply will not be intercepted while being transmitted to us over the Internet. Please be aware that any information you share with your friends and others under our \"share with your friend\" feature or \"Share your private showcase\" is at your own risk. You must responsibly choose whom to share the information with.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">We use third-party service providers to serve ads on our behalf across the Internet and sometimes on our site. These providers may collect anonymous information about your visits to our website, as well as your interaction with our products and services. This information may also be used to target advertisements for goods and services. The collection of this anonymous information is done through the use of a pixel tag, which is industry-standard technology used by most major websites. No personally identifiable information is collected or used in this process. These providers do not have access to your name, phone number, address, email address, or any personally identifying information about you.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">If you would like more information about this practice and your options to opt out of having this anonymous information collected by our third-party service provider, please click [here](http://www.networkadvertising.org/managing/opt_out.asp). You can also read more about online marketing practices and the technologies that support them by visiting the Network Advertising Initiative\'s website [here](http://www.networkadvertising.org/).</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">12. User Rights and Discretion</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">All personal information provided to Gond Sarkar International Pvt. Ltd. by you has been voluntarily provided. You have the right to request the deletion of your personal information at any time in writing by sending an email to us at care@baredezire.com. In accordance with the terms of this Privacy Policy, please include \"Requesting the deletion of my personal information\" in the subject line of your email. We will verify such requests before acting on them. However, please note that the withdrawal of consent will not be retrospective and will apply prospectively.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">You can review, modify, add, correct, or update your Personal Information on a regular basis. When you update information, we will retain a copy of the previous version for our records. Please be aware that we are not responsible for the authenticity of the Personal Information provided by you.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Please note that certain data or information cannot be corrected or deleted, or is prohibited from deletion as required under applicable law, law enforcement requests, orjudicial proceedings. In respect to such data or information, the aforementioned rights will not be available.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">In the event you withdraw consent provided to us under this Privacy Policy, we reserve the right to restrict or deny the provision of our services for which we consider such information to be necessary.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">A Final Note</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">The World Wide Web is an ever-evolving medium, and as such, our privacy policy may need to change at some point in the future. Any changes to our privacy policy will be posted before they take effect. Rest assured, our use of information will always be consistent with the policy under which the information was initially collected, regardless of any modifications to the policy.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">This Privacy Policy is effective as of October 14, 2023, and governs the use of our website and services provided by Gond Sarkar International Pvt. Ltd. We value your trust and appreciate your attention to this policy as we are dedicated to safeguarding your privacy.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-IN\">Please do not hesitate to contact us if you have any questions or require further information regarding our privacy practices or data handling. Your privacy is of utmost importance to us.</span></p>', '<h4 class=\"MsoNormal\" style=\"text-align: center;\"><strong><span lang=\"EN-GB\">Terms and Conditions for Bare Dezire Website</span></strong></h4>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">1. Eligibility:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">You must be eighteen years or older to use this site. If you are under eighteen, you may only use this site with the agreement of, and under the supervision of, a parent or guardian.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">2. Order Acceptance:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">By placing an order, the purchaser understands and agrees to all the terms and conditions of the offer. Orders will be executed only after the realization of the payments.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">3. Payment:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Cash on delivery charges, as indicated, may apply over and above the offer price.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">4. Delivery:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">We will take between 2-15 days for the delivery of the order/gift, subject to stock availability. All orders are subject to acceptance by us and product availability. Sizes once confirmed will not be changed.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">5. Stock Availability:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Offer is available only till stocks last.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">6. Termination of Offers:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Bare Dezire reserves the right to terminate or extend its various offers or any part thereof at any time.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">7. Credit Card Fraud:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Bare Dezire will not be liable for any credit card fraud. The liability of any fraudulent use of the card shall always be on the owner of the card unless proved otherwise.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">8. Customer Representation:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">You represent and warrant that all details you provide for the purpose of ordering or purchasing goods are true, accurate, current, and complete in all respects.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">9. Membership Termination:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Bare Dezire reserves the right to terminate your membership and refrain from fulfilling any further orders and to suspend or terminate your access to the site immediately and without notice to you if you fail to make payment when due or breach any of these Conditions.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">10. Product Availability:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Merchandise available for sale changes on a frequent basis, and we reserve the right to make changes in our merchandise without notice. Availability information for products is listed on each individual product description.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">11. Pricing:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The prices displayed on this website are quoted in Indian Rupees and are subject to change at any time and subject to applicable taxes.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">12. Order Acceptance:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">No relationship shall exist between you and Bare Dezire until we accept your order by shipping the product to you.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">13. Contact Information:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">By placing an order on Bare Dezire, you allow us to contact you via phone or SMS regarding your order, even if your number is registered on the DNC list.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">14. Discount Vouchers:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Discount vouchers can never be redeemed for cash, and you should follow separate terms and conditions applicable to each discount voucher.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">15. Use of Information:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">You agree that we may use and disclose information about you for marketing and promotional purposes.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">16. Product Images:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">We have taken great care to provide accurate product images, but the colors you see may vary due to monitor differences. We are not responsible for such variations.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">17. Use Restrictions:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">You agree not to reproduce, duplicate, copy, sell, resell, or exploit any portion of the product, use of the product, or access to the product/service for commercial purposes.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">18. Force Majeure:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">We shall have no liability for any delay in the delivery of products ordered due to events outside our reasonable control.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">19. Third-Party Material:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">We are not responsible for material displayed on third-party websites or any other written material.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">20. Individual Offer Terms:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">In case of orders where offers are applied, the terms associated with individual offers will take precedence.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">21. Governing Law:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">These Conditions shall be governed by and construed in accordance with the laws of the Republic of India.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">22. Liability Disclaimer:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">We shall not be responsible for any loss, liability, damage, personal injury, or expense arising from your use of the website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">23. Warranties:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">We make no warranties, representations, or guarantees regarding the website.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">24. External Links:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">External links provided for your convenience are beyond our control, and we are not responsible for their content.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">25. Trademarks:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The trademarks displayed on this website are registered and unregistered trademarks of Bare Dezire, and their use requires prior written permission.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">26. Use of the Website:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">By accessing the website, you warrant and represent that you are legally entitled to do so.</span></p>', '<h4 style=\"text-align: center;\"><strong>Bare Dezire Brand Returns Policy</strong></h4>\r\n<p>&nbsp;</p>\r\n<p>1.How do I return the order I have placed?&nbsp;</p>\r\n<p>You can return your order within 7 days of its delivery. To initiate a return, follow these steps:Log in to your account and click on the \'Return/Exchange\' link against your order in the Order History section.If you are a Guest User, provide your order details on the Track Order page and follow the instructions.Select the reason for the return, choose your preferred refund method, and confirm the request.Once your return request is submitted, we will prioritize its processing.</p>\r\n<p>&nbsp;</p>\r\n<p>2.I do not have an account with Bare Dezire. How do I return the order I have placed?&nbsp;</p>\r\n<p>You can return your order within 7 days of its delivery. To return an order as a Guest User, follow these steps:Go to the \'Return/Exchange\' link, indicate the reason for return, choose your refund preference, and confirm the request.If you choose a refund to your Bare Dezire account, you will be prompted to create an account, and the amount will be credited to your wallet.For refunds to the original payment method, the process will begin after our courier partner picks up the items and may take 3-7 business days. Please note that this option is not applicable for Bare Dezire wallet refunds.For reasons of hygiene, we do not accept returns or exchanges of specific items, including briefs, panties, or shapewear panties, and opened boxes of multi-piece sets that include panties.</p>\r\n<p>&nbsp;</p>\r\n<p>3.I&rsquo;m unable to see the return/exchange link on the product. What should I do?&nbsp;</p>\r\n<p>You can return your order within 7 days of its delivery. However, for hygiene reasons, certain items cannot be returned. The return/exchange option will be disabled in your account after 7 days from the order\'s delivery.</p>\r\n<p>&nbsp;</p>\r\n<p>4.I am unable to place a return request. Why is that?&nbsp;</p>\r\n<p>There are three reasons why the return option may not be available on our website or app:If your order is not marked as \"Delivered,\" you can only request a return after it\'s marked as delivered. This may take up to 24 hours.Make sure to use a bubble sheet wrap to secure the box and products inside and enclose your invoice. Also, include any Bare Dezire Collectible items or free gifts you received with your order.</p>\r\n<p>&nbsp;</p>\r\n<p>5.How do I track my return?</p>\r\n<p>&nbsp;We will send a confirmation email and SMS when your return order is picked up and received at our warehouse. In the case of an exchange request, you will receive SMS and email notifications when new items are dispatched. For refunds, you will receive an email when the refund is processed.</p>\r\n<p>&nbsp;</p>\r\n<p>6.How to Return the products?&nbsp;</p>\r\n<p>To return products, place unworn, unwashed merchandise with all tags attached in the original packaging. Use bubble sheet wrap to secure the box and products, enclose your invoice, and include any Bare Dezire Collectible gift items or free gift items received with your order. Please note that returns cannot be processed if items are used or damaged, or if tags are missing.</p>\r\n<p>&nbsp;</p>\r\n<p>7.How does GST vary for orders?</p>\r\n<p>GST may vary depending on factors such as the shipping location and product prices.</p>\r\n<p>&nbsp;</p>\r\n<p>8.If I return the order, will the GST amount charged be refunded?</p>\r\n<p>&nbsp;Yes, if you return an order, the GST amount will be refunded. However, shipping charges will not be refunded.</p>\r\n<p>&nbsp;</p>\r\n<p>9.If I cancel the order, will the GST amount charged be refunded?</p>\r\n<p>&nbsp;If you cancel an order before it is shipped, both the GST amount and shipping charges will be refunded.</p>\r\n<p>&nbsp;</p>\r\n<p>10.What are the items/services that cannot be returned or exchanged?&nbsp;</p>\r\n<p>We do not accept returns for briefs, panties, shapewear panties, or opened boxes of multi-piece sets that include panties due to hygiene reasons. Cash cannot be claimed against gift cards and gift wraps. Additionally, items sold as part of multipacks cannot be returned individually.</p>\r\n<p>&nbsp;</p>\r\n<p>11.Under what conditions can I return/replace my Bare Dezire product?&nbsp;</p>\r\n<p>You can return or replace your Bare Dezire product within 7 days of delivery under the following conditions:Wrong product deliveredExpired product deliveredDamaged product delivered (physical damage or tampered product/packaging).</p>\r\n<p>&nbsp;</p>\r\n<p>12.Under what conditions return/replacement requests will not be accepted for Bare Dezire products?</p>\r\n<p>Return/replacement requests will not be accepted for Bare Dezire products under the following conditions:Opened, used, or altered productsOriginal packaging (mono cartons, labels, etc.) missing</p>\r\n<p>Feel free to contact our customer care team at [Bare Dezire\'s customer care email] for any further assistance.</p>', '<h4 style=\"text-align: center;\"><strong>Bare Dezire Brand Shipping Policy</strong></h4>\r\n<p>&nbsp;</p>\r\n<p><strong>1. Processing Time:</strong><br>Orders are typically processed within 1-2 business days from the time they are placed. Please note that processing times may vary during peak seasons or promotional periods.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>2. Shipping Methods:</strong><br>We offer several shipping options to meet your needs. The available shipping methods and estimated delivery times will be displayed during the checkout process. Please select the method that best suits your preferences.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>3. Shipping Locations:</strong><br>Bare Dezire currently ships to India only. If your country is not listed during the checkout process, please contact our customer support for assistance.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>4. Shipping Costs:</strong><br>Shipping costs are calculated based on the weight of your order and the selected shipping method. The total shipping cost will be displayed during the checkout process before you complete your purchase.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>5. Customs and Duties:</strong><br>Customers are responsible for any customs duties, taxes, or fees that may be incurred upon delivery. Bare Dezire is not responsible for delays caused by customs processing.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>6. Tracking Information:</strong><br>Once your order has been shipped, you will receive a confirmation email with tracking information. You can use this information to track the status of your shipment.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>7. Delivery Time:</strong><br>Delivery times may vary depending on your location and the selected shipping method. Please refer to the estimated delivery times provided during the checkout process. Please note that unforeseen circumstances, such as weather conditions or customs delays, may affect delivery times.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>8. Missing or Lost Packages:</strong><br>If your package is lost or missing, please contact our customer support team as soon as possible. We will work with the shipping carrier to investigate and resolve the issue.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>9. Returns Due to Incorrect Address:</strong><br>Customers are responsible for providing accurate shipping information. If a package is returned due to an incorrect address provided by the customer, additional shipping fees may apply for reshipment.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>10. Contact Information:</strong><br>If you have any questions or concerns about our shipping policy, please contact our customer support team at support@baredezire.com or 9831581634</p>\r\n<p>&nbsp;</p>', '<h4 style=\"text-align: center;\"><strong>About Bare Dezire Brand</strong></h4>\r\n<p>&nbsp;</p>\r\n<p>Bare Dezire was founded with the vision of providing comfortable, stylish, and affordable lingerie for women. The brand focuses on empowering women by offering them a wide variety of lingerie options that cater to different preferences, body types, and occasions.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Key Points about Bare Dezire</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product Range:</strong><br>Bare Dezire offers a comprehensive range of lingerie, including bras, panties, nightwear, shapewear, and more. The brand is known for its commitment to quality and attention to detail in design.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Innovative Designs:</strong><br>Bare Dezire is recognized for its innovative and trendy designs. The brand constantly introduces new styles, keeping up with the latest fashion trends while ensuring that the lingerie is both functional and comfortable.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Fit and Comfort:</strong><br>A notable aspect of Bare Dezire\'s &nbsp;philosophy is its emphasis on providing lingerie that not only looks good but also fits well and is comfortable for everyday wear. The brand understands the importance of well-fitted innerwear for overall confidence and comfort.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Affordability:</strong><br>Bare Dezire aims to make quality lingerie accessible to a wide range of customers. The brand often provides affordable options without compromising on the quality of materials or craftsmanship.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Online Presence:</strong><br>Bare Dezire operates through its online platform, allowing customers to browse and purchase products from the comfort of their homes. This online approach contributes to the brand\'s accessibility and reach.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Body Positivity:</strong><br>Bare Dezire embraces body positivity and strives to create a positive and inclusive environment for women. The brand\'s marketing and communication often reflect a celebration of diversity and individuality.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Customer Satisfaction:</strong><br>Customer reviews and satisfaction are crucial for Bare Dezire. The brand encourages feedback and aims to continually improve its products and services based on customer input.</p>\r\n<p>&nbsp;</p>', '2023-11-08 06:09:43', '2024-01-23 09:30:06');
