INSERT INTO `products` (`id`, `sku`, `name`, `slug`, `original_price`, `selling_price`, `color_id`, `description`, `wash`, `additional`, `status`, `is_featured`, `is_delete`, `is_offer`, `view`, `meta_title`, `meta_description`, `meta_tags`, `created_at`, `updated_at`) VALUES
(13, 'BD789BRSPTCH007-BLACK', 'Non-Padded Non-Wired Beginners Bra (BLACK)', 'non-padded-non-wired-beginners-bra-black', 2099.00, 1569.00, NULL, '<p>Introducing our high-performance Beginners Bra &ndash; the ultimate companion for your active lifestyle. Designed to deliver unbeatable support and comfort, this Beginners bra is engineered to elevate your workout experience.</p>\r\n<p>Can Fit till size: 28 - 32</p>', '<p>Always read and follow the care label on your bras. Manufacturers provide specific washing instructions that should be your primary guide.Hand washing is the gentlest way to clean bras.Submerge the bras in the soapy water and agitate the water gently.Gently rub the fabric to remove dirt, sweat, and oils, paying extra attention to stained or odorous areas.Rinse the bras thoroughly with cool water until all soap is removed.If you choose to machine wash your bras, use a lingerie bag or pillowcase with the bra clasp fastened to prevent snagging and stretching.Use a gentle cycle with cold water.Before washing, always fasten the hooks of your bras to prevent them from snagging other clothing.Avoid using bleach, fabric softeners, or harsh detergents as they can damage the fabric and elastic.Avoid using hot water or hot air when cleaning or drying bras, as heat can weaken elastic fibers and damage the fabric.Remember that proper care can significantly extend the lifespan of your bras, making them more comfortable and cost-effective in the long run.Hand wash.Do not iron.Do not bleach.Wash after every wear.Use a mild detergent &amp; lukewarm water to wash them.Replace your bras every 6 to 9 months</p>', '<div class=\"prdetail prddetails_addinfo\">\r\n<p><strong>Net Qty</strong>1 U</p>\r\n</div>\r\n<div class=\"prdetail prddetails_addinfo\"><strong>Package Contains</strong>1 N Bra</div>', 1, 1, 1, 1, 0, 'Non Padded Non Wired Beginners Bra Black', NULL, NULL, '2023-09-14 14:59:27', '2024-01-27 07:51:33'),
(14, 'BD789BRSPTCH007-ASH', 'Women Sports Lightly Padded Bra (ASH)', NULL, 2799.00, 699.00, NULL, '<p>Introducing our high-performance Sports Bra &ndash; the ultimate companion for your active lifestyle. Designed to deliver unbeatable support and comfort, this sports bra is engineered to elevate your workout experience.</p>', '<p>Always read and follow the care label on your bras. Manufacturers provide specific washing instructions that should be your primary guide.Hand washing is the gentlest way to clean bras.Submerge the bras in the soapy water and agitate the water gently.Gently rub the fabric to remove dirt, sweat, and oils, paying extra attention to stained or odorous areas.Rinse the bras thoroughly with cool water until all soap is removed.If you choose to machine wash your bras, use a lingerie bag or pillowcase with the bra clasp fastened to prevent snagging and stretching.Use a gentle cycle with cold water.Before washing, always fasten the hooks of your bras to prevent them from snagging other clothing.Avoid using bleach, fabric softeners, or harsh detergents as they can damage the fabric and elastic.Avoid using hot water or hot air when cleaning or drying bras, as heat can weaken elastic fibers and damage the fabric.Remember that proper care can significantly extend the lifespan of your bras, making them more comfortable and cost-effective in the long run.Hand wash.Do not iron.Do not bleach.Wash after every wear.Use a mild detergent &amp; lukewarm water to wash them.Replace your bras every 6 to 9 months</p>', '<div class=\"prdetail prddetails_addinfo\">\r\n<p><strong>Net Qty</strong>1 U</p>\r\n</div>\r\n<div class=\"prdetail prddetails_addinfo\"><strong>Package Contains</strong>1 N Bra</div>', 1, 0, 0, 1, 0, NULL, NULL, NULL, '2023-09-14 15:05:06', '2023-11-07 10:00:11'),
(15, 'BD789BRSPTCH007-BLUE', 'Non-Padded Non-Wired Beginners Bra (BLUE)', 'non-padded-non-wired-beginners-bra-blue', 2099.00, 1569.00, NULL, '<p>Introducing our high-performance Beginners Bra &ndash; the ultimate companion for your active lifestyle. Designed to deliver unbeatable support and comfort, this Beginners bra is engineered to elevate your workout experience.</p>\r\n<p>Can Fit till size: 28 - 32</p>', '<p>Always read and follow the care label on your bras. Manufacturers provide specific washing instructions that should be your primary guide.Hand washing is the gentlest way to clean bras.Submerge the bras in the soapy water and agitate the water gently.Gently rub the fabric to remove dirt, sweat, and oils, paying extra attention to stained or odorous areas.Rinse the bras thoroughly with cool water until all soap is removed.If you choose to machine wash your bras, use a lingerie bag or pillowcase with the bra clasp fastened to prevent snagging and stretching.Use a gentle cycle with cold water.Before washing, always fasten the hooks of your bras to prevent them from snagging other clothing.Avoid using bleach, fabric softeners, or harsh detergents as they can damage the fabric and elastic.Avoid using hot water or hot air when cleaning or drying bras, as heat can weaken elastic fibers and damage the fabric.Remember that proper care can significantly extend the lifespan of your bras, making them more comfortable and cost-effective in the long run.Hand wash.Do not iron.Do not bleach.Wash after every wear.Use a mild detergent &amp; lukewarm water to wash them.Replace your bras every 6 to 9 months</p>', '<div class=\"prdetail prddetails_addinfo\">\r\n<p><strong>Net Qty</strong>1 U</p>\r\n</div>\r\n<div class=\"prdetail prddetails_addinfo\"><strong>Package Contains</strong>1 N Bra</div>', 1, 0, 1, 1, 0, 'Non Padded Non Wired Beginners Bra Blue', NULL, NULL, '2023-09-14 15:45:33', '2024-01-27 07:51:37'),
