(107, 'BD789TNG002', 'Non Padded Wirefree Beginner Bra (Yellow)', 'non-padded-wirefree-beginner-bra-yellow', 999.00, 749.00, NULL, '<p>Designed for high-impact activities like running, HIIT, or CrossFit, it offers unbeatable support to minimize bounce and maximize confidence. Our sports bra features advanced moisture-wicking technology that keeps you dry and comfortable even during the most intense workouts, ensuring you can push your limits without distractions.</p>\r\n<p>The breathable fabric ensures proper ventilation, preventing overheating and discomfort. The racerback design allows for unrestricted movement, making it ideal for various sports and fitness routines. Plus, the wide, adjustable straps and hook-and-eye closure ensure a custom fit tailored to your body, while the soft, seamless construction reduces chafing and irritation.</p>\r\n<p>With a sleek and stylish design, this sports bra not only performs exceptionally but also looks great. Whether you\'re hitting the gym or hitting the pavement, you can count on this sports bra to provide the support and confidence you need to achieve your fitness goals.</p>\r\n<p>Invest in the best, invest in yourself. Elevate your workout experience with our sports bra &ndash; the perfect blend of performance, comfort, and style. Order yours today and experience the difference for yourself.</p>', '<div class=\"flex-1 overflow-hidden\">\r\n<div class=\"react-scroll-to-bottom--css-tparw-79elbk h-full dark:bg-gray-800\">\r\n<div class=\"react-scroll-to-bottom--css-tparw-1n7m0yu\">\r\n<div class=\"flex flex-col text-sm dark:bg-gray-800\">\r\n<div class=\"group w-full text-token-text-primary border-b border-black/10 gizmo:border-0 dark:border-gray-900/50 gizmo:dark:border-0 bg-gray-50 gizmo:bg-transparent dark:bg-[#444654] gizmo:dark:bg-transparent\" data-testid=\"conversation-turn-5\">\r\n<div class=\"p-4 justify-center text-base md:gap-6 md:py-6 m-auto\">\r\n<div class=\"flex flex-1 gap-4 text-base mx-auto md:gap-6 gizmo:gap-3 gizmo:md:px-5 gizmo:lg:px-1 gizmo:xl:px-5 md:max-w-2xl lg:max-w-[38rem] gizmo:md:max-w-3xl gizmo:lg:max-w-[40rem] gizmo:xl:max-w-[48rem] xl:max-w-3xl }\">\r\n<div class=\"relative flex w-[calc(100%-50px)] flex-col gap-1 gizmo:w-full md:gap-3 lg:w-[calc(100%-115px)] agent-turn\">\r\n<div class=\"flex flex-grow flex-col gap-3 max-w-full\">\r\n<div class=\"min-h-[20px] flex flex-col items-start gap-3 whitespace-pre-wrap break-words overflow-x-auto\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<ol>\r\n<li>\r\n<p><strong>Check the Care Label</strong>: Always begin by checking the care label on your sports bra for specific washing instructions. Different fabrics and brands may have slightly different recommendations.</p>\r\n</li>\r\n<li>\r\n<p><strong>Hand Wash or Machine Wash on Gentle Cycle</strong>: In general, it\'s best to hand wash your sports bra using a gentle detergent. If you prefer to use a washing machine, place the bra in a mesh lingerie bag to protect it from friction and potential damage. Use a gentle or sports-specific cycle with cold water.</p>\r\n</li>\r\n<li>\r\n<p><strong>Avoid Fabric Softeners and Bleach</strong>: Fabric softeners can break down the elasticity of the bra\'s materials, so it\'s best to avoid them. Additionally, never use bleach, as it can damage the fabric and affect the bra\'s color.</p>\r\n</li>\r\n<li>\r\n<p><strong>Use Mild Detergent</strong>: Choose a mild, non-bleaching, and non-fabric-softener detergent to preserve the integrity of the fabric and elastics.</p>\r\n</li>\r\n<li>\r\n<p><strong>Fasten Hooks and Adjust Straps</strong>: Before washing, fasten any hooks or clasps and adjust the straps to prevent them from tangling or snagging during the wash cycle.</p>\r\n</li>\r\n<li>\r\n<p><strong>Wash with Similar Colors</strong>: To prevent color bleeding, wash your sports bra with similar-colored clothing items. Avoid washing it with jeans or other abrasive materials that might cause pilling.</p>\r\n</li>\r\n<li>\r\n<p><strong>Skip the Dryer</strong>: Heat can weaken the elastic fibers in your sports bra, so it\'s best to air dry it. Lay it flat on a clean towel or hang it to dry in a shaded area. Avoid hanging it by the straps to prevent stretching.</p>\r\n</li>\r\n<li>\r\n<p><strong>Keep it Away from Sunlight</strong>: Direct sunlight can cause fading, so always dry your sports bra in the shade or indoors.</p>\r\n</li>\r\n<li>\r\n<p><strong>Avoid Wrinkling</strong>: After washing, reshape the cups and straps of your sports bra to maintain their original shape.</p>\r\n</li>\r\n</ol>\r\n<p>By following these washing instructions, you\'ll help prolong the life of your sports bra and ensure that it continues to provide the support and comfort you need during your workouts.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"flex justify-between empty:hidden lg:block\">\r\n<div class=\"text-gray-400 flex self-end lg:self-center justify-center gizmo:lg:justify-start mt-2 gizmo:mt-0 visible lg:gap-1 lg:absolute lg:top-0 lg:translate-x-full lg:right-0 lg:mt-0 lg:pl-2 gap-2 md:gap-3\"><button class=\"flex ml-auto gizmo:ml-0 gap-2 items-center rounded-md p-1 text-xs gizmo:gap-1.5 gizmo:pl-0 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-gray-200 disabled:dark:hover:text-gray-400 hover:bg-gray-100 hover:text-gray-700\"></button>\r\n<div class=\"flex gap-1 gizmo:gap-3\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"h-32 md:h-48 flex-shrink-0\">&nbsp;</div>\r\n<button class=\"cursor-pointer absolute right-6 gizmo:right-1/2 bottom-[124px] md:bottom-[180px] gizmo:md:bottom-[143px] lg:bottom-[120px] z-10 rounded-full border border-gray-200 gizmo:border-black/10 bg-gray-50 text-gray-600 dark:border-white/10 dark:bg-white/10 gizmo:bg-token-surface-primary dark:text-gray-200\"></button></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"absolute bottom-0 left-0 w-full border-t md:border-t-0 dark:border-white/20 md:b